INSERT INTO ARCH_NOTIFICATION ( ID, NAME, DESCRIPTION ) VALUES ( 
1, 'Queue Monitor', NULL); 
declare
nl varchar2(2):=chr(10)||chr(13);
sqltext varchar2(2000);
temp long raw;
begin
sqltext:='QueueMonitor Message Waiting Notifcation
========================================
Address Id = $ADDRESS_ID
Adress Name = $ADDRESS_NAME 
transport type = $TRANSPORT_TYPE
request in queue = $MESSAGE_COUNT 
wait time = $TIME_WAIT
UID: $G_UID
TIME: $G_TIME
SERVER: $G_SERVER
NOTIFICATION ID: $G_NOTIFICATION_ID';
execute immediate 'update arch_notification set text=EMPTY_BLOB() where id=1';
temp:=utl_raw.cast_to_raw(sqltext);
update arch_notification set text=temp where id=1;
end;
/
INSERT INTO ARCH_NOTIFICATION ( ID, NAME, DESCRIPTION ) VALUES ( 
4, 'Protocol-Group Processing', 'Protocol Handling Notification - Group Processing'); 
declare
nl varchar2(2):=chr(10)||chr(13);
sqltext varchar2(2000);
temp long raw;
begin
sqltext:='Protocol Handling Notification (Group handling)
==============================================
A group send by client $CLIENT_NAME (client id: $CLIENT_ID) at $G_TIME failed processing for the following reason:
Error Message: $ERR_MSG
#if ( $PROTOCOL_TYPE==''NORMAL'' )
Group Data:
#foreach( $row in $GROUP_DATA)
#foreach( $column in $row) $column #end
#end
#else
#if ( $GROUP_DATA.size() > 0 )
Group Data(Xml):$GROUP_DATA.get(0).get(0)
#end
#end
--------------------------------------
UID: $G_UID
TIME: $G_TIME
SERVER: $G_SERVER
NOTIFICATION ID: $G_NOTIFICATION_ID';
execute immediate 'update arch_notification set text=EMPTY_BLOB() where id=4';
temp:=utl_raw.cast_to_raw(sqltext);
update arch_notification set text=temp where id=4;
end;
/
INSERT INTO ARCH_NOTIFICATION ( ID, NAME, DESCRIPTION ) VALUES ( 
3, 'Protocol-File Processing', 'Protocol Handling Notification - File Processing'); 
declare
nl varchar2(2):=chr(10)||chr(13);
sqltext varchar2(2000);
temp long raw;
begin
sqltext:='Protocol Handling Notification (File handling)
==============================================
A file send by client $CLIENT_NAME (client id: $CLIENT_ID) at $G_TIME failed processing for the following reason:
Error Message: $ERR_MSG
--------------------------------------
UID: $G_UID
TIME: $G_TIME
SERVER: $G_SERVER
NOTIFICATION ID: $G_NOTIFICATION_ID';
execute immediate 'update arch_notification set text=EMPTY_BLOB() where id=3';
temp:=utl_raw.cast_to_raw(sqltext);
update arch_notification set text=temp where id=3;
end;
/
INSERT INTO ARCH_NOTIFICATION ( ID, NAME, DESCRIPTION ) VALUES ( 
6, 'Protocol-Request Processing', 'Protocol Handling Notification - notification for single request failure in Flow processing'); 
declare
nl varchar2(2):=chr(10)||chr(13);
sqltext varchar2(2000);
temp long raw;
begin
sqltext:='Protocol Handling Notification (Request handling)
==============================================
A request send by client $CLIENT_NAME (client id: $CLIENT_ID) at $G_TIME failed processing for the following reason:Error Message: $ERR_MSG
Trade Type: $TRADE_TYPE
Group Data:
#if ( $TRADE_TYPE==''OA'' )
OA:
#foreach( $row in $GROUP_DATA)
#foreach( $column in $row) $column #end
#end
#elseif ( $TRADE_TYPE==''NOE'' )
NOE:
#foreach( $row in $GROUP_DATA)
#foreach( $column in $row) $column #end
#end
#elseif ( $TRADE_TYPE==''NOE_AND_OA'' )
#set( $index = 0 )
#foreach( $row in $GROUP_DATA)
#if( $index == 0)
NOE:
#elseif ($index == 1)
OA:
#end
#foreach( $column in $row) $column #end
#set( $index = $index + 1 )
#end
#else
#if ( $GROUP_DATA.size() > 0 )
Group Data(Xml):$GROUP_DATA.get(0).get(0)
#end
#end
--------------------------------------
UID: $G_UID
TIME: $G_TIME
SERVER: $G_SERVER
NOTIFICATION ID: $G_NOTIFICATION_ID';
execute immediate 'update arch_notification set text=EMPTY_BLOB() where id=6';
temp:=utl_raw.cast_to_raw(sqltext);
update arch_notification set text=temp where id=6;
end;
/

